import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import MainPage from "./pages/MainPage";

export const Routes = () => {
    return (
        <Router>
            <Switch>
                <Route path="/">
                    <MainPage />
                </Route>
            </Switch>
        </Router>
    )
}
